import React, { Component } from 'react';

class CalenderComponent extends Component {
    constructor(props) {
        super(props);
        this.state = {
            weeks: ['日', '月', '火', '水', '木', '金', '土']
        }
    }
    render() {
        return (
            <table>
                <tr>
                    <td>日</td>
                    <td>月</td>
                    <td>火</td>
                    <td>水</td>
                    <td>木</td>
                    <td>金</td>
                    <td>土</td>
                </tr>
                <td>
                    date:??
            </td>
            </table>
        )
    }
}
export default CalenderComponent;
